    <div className="w-full p-2 rounded-md shadow-sm border border-slate-100 flex items-center">
      <div>{menuItem.name}</div>

      <div className="text-purple-normal font-bold ml-auto">
        {menuItem.price} EUR
      </div>

      <div>
        <ButtonSecondary onClick={() => console.log("jeadaefe")}>
          <div className="font-bold text-3xl">+</div>
        </ButtonSecondary>
      </div>
    </div>
  );
};

export default MenuItem;
